                        </div>
                    </div>
                    {/* <button onClick={()=>addReviews()}>click</button> */}
                    <div className='otziv_all_reviews'>{item.otziv_all_reviews}</div>
                </div>
            )
        })
        }else{
            // console.log('0reviews')
        }
        return (
                <div className="films">
                    {newPlates2}
                </div>
            )
        }


